import { GetUsers } from '../DataCollection/Request'
import { useEffect, useState } from 'react';

export const RenderMeeting = (props) => {
  const [event, setEvent] = useState();
  var x = [];
  GetUsers().then((res) => {
     return res.map((data) => { return x.push(data)});
  });

  

  x.map((data) => {
    console.log(data)
  })
 

